        id: 2,
        name: "Stretcha nacke åt sidan",
        desc: "Luta huvudet och sidan och strechta nacken på båda sidorna, glöm inte att andas",
    },
    {
        id: 3,
        name: "Luta mot väggen",
        desc: "Luta dig mot väggen med ryggen och tryck rycken och svanken mot väggen. Sträck händerna längst väggen",
